func Test_4Mutiply0(t *testing.T) {

	I := MakeMatrix4().MakeIdentity()

	A := makeA()
	ai := makeA().Inverse()
	da := A.Determinant()
	B := makeB()
	bi := makeB().Inverse()
	C := makeC()
	ci := makeC().Inverse()

	a := A.MultiplyM(ai)
	if !I.ApproxEquals(a, ε4d) {
		fmt.Println("a=", A)
		fmt.Println("det(a)=", da)
		fmt.Println("ai=", A)
		fmt.Println("I=", a)
		t.Fail()
	}
	b := B.MultiplyM(bi)
	if !I.ApproxEquals(b, ε4d) {
		fmt.Println("b", b)
		fmt.Println("I", I)
		t.Fail()
	}
	c := C.MultiplyM(ci)
	if !I.ApproxEquals(c, ε4d) {
		fmt.Println("c", c)
		fmt.Println("i", I)
		t.Fail()
	}
}

