func Test_4Mutiply3(t *testing.T) {
	if !setup4 {
		Setup4()
	}
	I := MakeMatrix4().MakeIdentity()

	for i := 0; i < len(a4Array); i++ {
		A := MakeMatrix4V(a4Array[i], true)
		B := MakeMatrix4V(b4Array[i], true)
		at := A.Copy().Transpose()
		ati := at.Copy().Inverse()
		bt := B.Copy().Transpose()
		bti := bt.Copy().Inverse()
		ai := A.Copy().Inverse()
		bi := B.Copy().Inverse()

		p := A.Copy().MultiplyM(B).MultiplyM(at).MultiplyM(bt).MultiplyM(bti).MultiplyM(ati).MultiplyM(bi).MultiplyM(ai)

		// Allow the ε to be larger, we're multiplying a long chain of matrixes
		if !I.ApproxEquals(p, ε4d*100) {
			fmt.Println("failed to multiply 'A*B*At*Bt*Inv(Bt)*Inv(At)*Inv(B)*Inv(A)'. Expected result as 'I', got 'p'")
			fmt.Println("A	=", A)
			fmt.Println("B	=", B)
			fmt.Println("I	=", I)
			fmt.Println("p	=", p)
			fmt.Println()
			t.Fail()
		}
	}
}

